exports=async function(url,bid,cid,options){const{send}=require("http"),clientOptions={...(options&&options.clientOptions),encoding:"utf-8","x-mobile":0};stat("request");let response=await send(url,clientOptions);stat("request"),assertOK(response);let html=response.body;const urls=JSON.parse(html.subRegex(/"page_url":(\[[^\]]+\]),/));return {urls}};